import React from "react";
import Item from "./item_after_10.js";

export default function ListAfter10({ data }) {
  console.log('I make item');
  return (
    <ul className="item-wrapper">
      {data.map(row => (
        <Item row={row} key={row.userID} />
      ))}
      
    </ul>
  );
 
}
